ivities reflected in the materials accessioned. (See DACS Rule 3.1 for more information.)',NULL,3),(40,3,65,2081,'donor','Open this section to record information about the donor of this accession.',NULL,3),(41,3,65,2081,'donor_donor','Use this field to name the person or organization that offered the accession to your institution.',NULL,3),(42,3,65,2081,'donor_donorcontactinformation','Use this field to provide contact information for the person or organization that offered the accession to your institution.',NULL,3),(43,3,65,2081,'donor_donornotes','Use this field to provide additional information about the donor of the accession being added or updated.',NULL,3),(44,3,65,2081,'enabled','Changing this radio button to \'no\' will suppress the public view of the accession\'s existence.',NULL,3),(45,3,65,2081,'expectedcompletiondate','Use this field to record the expected date of completion for the accession\'s processing.',NULL,3),(46,3,65,2081,'header','Use the Accessions Manager to describe newly acquired materials that have not been processed and cataloged.  \n\nInformation from an accession record may be associated with one or more existing classifications or collections, and may be used to seed a new collection record.',NULL,3),(47,3,65,2081,'identifier','Use this field to record a unique identifier for the accession.',NULL,3),(48,3,65,2081,'inclusivedates','Use this field to record the date(s) that pertain to the creation, assembly, or accumulation of the materials being described.  As necessary, use a single date, span of dates, or comma-separated list of dates and/or date spans.  (See DACS Rule 2.4 for more information.)',NULL,3),(49,3,65,2081,'locations','Open this area to record the locations where boxes or other containers in this accession are being stored prior to processing.',NULL,3),(50,3,65,2081,'locations_content','Use this field to record the container number(s) that are stored at the specified location.',NULL,3),(51,3,65,2081,'locations_extent','Use