,2081,'idontknow','I Don\'t Know',NULL,5),(105,2,0,2081,'low','Low',NULL,5),(106,2,0,2081,'module_name','Assessments Manager',NULL,5),(107,2,0,2081,'package_name','AvSAP',NULL,5),(108,2,0,2081,'print','Print',NULL,5),(109,2,0,2081,'repository','Repository',NULL,5),(110,2,0,2081,'repositoryid','Repository',NULL,5),(111,2,0,2081,'score','Score',NULL,5),(112,2,61,2081,'access','Assessment for material access policies.',NULL,3),(113,2,61,2081,'accessavdisasterrecoverytools','Several services exist in the United States to help institutions respond to disasters affecting their audiovisual materials. If your institution knows about and has access to disaster recovery services that specialize in handling audiovisual materials, click [b]\"yes\" [/b]and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/accessavdisasterrecoverytools.html]Click through[/url] for a list of audiovisual disaster recovery services.',NULL,3),(114,2,61,2081,'accesscopies','Creating copies of your materials for use can protect the original materials from unnecessary wear. If your institution regularly creates access copies for your audiovisual materials, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/accesscopies.html]Click through[/url] for more information about what access copies are and how they are used.',NULL,3),(115,2,61,2081,'allowloaninginstitutions','Shipping materials to other institutions can put them at risk for damage. If your institution regularly loans audiovisual materials to other institutions, click [b]\"yes\" [/b]and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/allowloaninginstitutions.html]Click through[/url] for more information about the dangers of shipping/transporting audiovisual materials.',NULL,3),(116,2,61,2081,'allowloaningother','Allowing the public to take audiovisual materials off premises severely constrains your ability to monitor the materials\' use and can put them at extreme risk. If your institution routinely allows materials to leave the premises with the public, click [b]\"yes\"[/b] and if not, click[b] \"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/allowloaningother.html]Click through[/url] for more information about circulating audiovisual collections and the risks inherent in allowing materials to leave the premises with the public.',NULL,3),(117,2,61,2081,'allowplayback','Allowing untrained people to playback audiovisual materials unaided can put those materials at extreme risk. If your institution regularly allows untrained people (staff members or the public) to play back audiovisual materials without assistance, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/allowplayback.html]Click through [/url]for more information about unmonitored playback and the risks it can pose to audiovisual materials.',NULL,3),(118,2,61,2081,'avdisasterrecoveryplan','Responding to disasters that involve audiovisual materials can be very different from responding to disasters that only involve books and paper materials. If your institution\'s disaster plan specifically includes audiovisual materials, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/avdisasterrecoveryplan.html]Click through[/url] for more information about audiovisual materials and disaster plans.',NULL,3),(119,2,61,2081,'avpreservationplan','Having a preservation plan for your collections is excellent but you want to make sure that some part of it is directly focused on audiovisual materials. If your preservation plan specifically includes audiovisual materials, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/avpreservationplan.html]Click through[/url] for more information about audiovisual-specific preservation plans.',NULL,3),(120,2,61,2081,'catalogcollections','Poorly-cataloged materials can easily be overlooked by your preservation efforts. If we can\'t find an item, we don\'t know it\'s there. If you routinely catalog or otherwise describe/record your materials, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/catalogcollections.html]Click through[/url] for more information about cataloging/description and audiovisual materials.',NULL,3),(121,2,61,2081,'collectionpolicy','Having a policy that guides what materials you collect and how you collect them can help you focus your efforts and funds with regards to preservation. If you have such a policy, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/collectionpolicy.html]Click through[/url] for more information about collecting policies and audiovisual materials.',NULL,3),(122,2,61,2081,'dedicatedinspectionspace','Dedicating a clean, well-lit space in your facility for inspecting audiovisual materials is very important. If your institution has such a space, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/dedicatedinspectionspace.html]Click through[/url] for more information about audiovisual inspection spaces.',NULL,3),(123,2,61,2081,'digitalcopies','Creating digital copies of audiovisual materials can protect the originals from wear. If your institution routinely creates digital copies of its analog originals, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/digitalcopies.html]Click through[/url] for more information about digitization of audiovisual materials.',NULL,3),(124,2,61,2081,'disasterplanning','Assessment for disaster planning and recovery of materials.',NULL,3),(125,2,61,2081,'disasterrecoveryplan','Having a concise, clear plan for how to deal with a disaster is essential for any institution. If your institution has such a plan, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/disasterrecoveryplan.html]Click through[/url] for more information about general disaster plans and online tools for how to generate one.',NULL,3),(126,2,61,2081,'equipment','Assessment for playback equipment policies and maintenance.',NULL,3),(127,2,61,2081,'equipmentmanuals','Maintaining and troubleshooting playback equipment in-house can be made much easier if you have the appropriate instruction manuals for the equipment. If you have manuals for at least some of your equipment, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/equipmentmanuals.html]Click through[/url] for more information about procuring audiovisual equipment manuals.',NULL,3),(128,2,61,2081,'equipmentpartsservice','As audiovisual equipment becomes obsolete it becomes harder to find parts and service for it. If you can procure parts and/or find repair services for your audiovisual equipment, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/equipmentpartsservice.html]Click through[/url] for more information about finding parts and service for your audiovisual playback equipment.',NULL,3),(129,2,61,2081,'inspection','Assessment for material inspection methods and material care.',NULL,3),(130,2,61,2081,'maintainplaybackequipment','Maintaining playback equipment is an important part of making your audiovisual materials accessible. If you have staff who know how to properly maintain your playback equipment, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/maintainplaybackequipment.html]Click through[/url] for more information about the importance of preserving audiovisual playback equipment.',NULL,3),(131,2,61,2081,'ownershiprecords','Keeping a good record of the rights conferred to your institution by donors of materials is important in order to decide what you can legally do with your institution\'s collections. If your institution routinely keeps these kinds of records, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/ownershiprecords.html]Click through[/url] for more information about ownership/rights records.',NULL,3),(132,2,61,2081,'preservation','Assessment for preservation planning and mission for institutions.',NULL,3),(133,2,61,2081,'preservationplan','Having a comprehensive plan for how you will allocate funds and time toward the preservation of your materials will help you make targeted and informed choices about your audiovisual materials. If you have such a plan click [b]\"yes\"[/b] and if you do not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/preservationplan.html] Click through[/url] for more information about preservation plans.',NULL,3),(134,2,61,2081,'staffcleanrepair','Knowing how to repair your audiovisual materials in-house requires a great deal of specialized knowledge. If you or your staff know how to repair and maintain at least some of the audiovisual formats your institution collections, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/staffcleanrepair.html]Click through[/url] for more information about audiovisual media repair and how to obtain this kind of knowledge.',NULL,3),(135,2,61,2081,'staffplaybackinspections','Performing playback inspections of audiovisual items can give very good information about the condition of the items. However, playback always carries with it the risk of damage to the audiovisual items being played back. If you or your staff routinely perform playback inspections of your institution\'s audiovisual items. click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n[url=packages/avsap/adminhelp/repository/eng/staffplaybackinspections.html]Click through[/url] for more information about playback inspections and the risks playback carries.',NULL,3),(136,2,61,2081,'staffvisualinspections','Visual inspections of audiovisual materials are admittedly limited in their utility but can still be beneficial. If you or your staff routinely perform visual inspections of your institution\'s audiovisual materials, click [b]\"yes\"[/b] and if not, click [b]\"no.\"[/b] \n\n[url=packages/avsap/adminhelp/repository/eng/staffvisualinspections.html]Click through[/url] for more information about visual inspections, their strengths and their weaknesses.',NULL,3),(137,2,61,2081,'access','Access to Materials',NULL,5),(138,2,61,2081,'accessavdisasterrecoverytools','Do you have access to disaster recovery tools/services for AV materials in the event that a disaster occurs?',NULL,5),(139,2,61,2081,'accesscopies','How many access copies do you have of your institution\'s audiovisual items?',NULL,5),(140,2,61,2081,'allowloaninginstitutions','Does your institution allow its media originals to leave the premises for the purpose of being loaned to other institutions?',NULL,5),(141,2,61,2081,'allowloaningother','Does your institution allow its media originals to leave the premises with your guests/users/patrons?',NULL,5),(142,2,61,2081,'allowplayback','Does the institution allow media originals to be played back by non-staff members without assistance?',NULL,5),(143,2,61,2081,'avdisasterrecoveryplan','Do you have an AV-specific disaster plan or an AV component to your larger disaster plan?',NULL,5),(144,2,61,2081,'avpreservationplan','Does your institution have a general preservation plan specific to its AV materials or does the general preservation plan incorporate considerations specific to AV materials?',NULL,5),(145,2,61,2081,'catalogcollections','Does your institution catalog or describe your media items/collections?',NULL,5),(146,2,61,2081,'collectionpolicy','Does your institution have a policy or policies that guide what materials (formats and content) that it collects?',NULL,5),(147,2,61,2081,'dedicatedinspectionspace','Does your institution have a dedicated handling/inspection space for media?',NULL,5),(148,2,61,2081,'digitalcopies','How many of your institution\'s audiovisual items have digital copies?',NULL,5),(149,2,61,2081,'disasterplanning','Disaster Recovery',NULL,5),(150,2,61,2081,'disasterrecoveryplan','Does your institution have a current disaster recovery plan?',NULL,5),(151,2,61,2081,'equipment','Playback Equipment',NULL,5),(152,2,61,2081,'equipmentmanuals','How many of the manuals/instructions for your playback machines does your institution keep?',NULL,5),(153,2,61,2081,'equipmentpartsservice','For how many of your playback machines can you find service and/or parts  in the event of mechanical failure?',NULL,5),(154,2,61,2081,'header','Institutions Manager',NULL,5),(155,2,61,2081,'idontknow','I Don\'t Know',NULL,5),(156,2,61,2081,'inspection','Material Inspection',NULL,5),(157,2,61,2081,'maintainplaybackequipment','How many of your playback equipment types are you and/or your staff able to clean and maintain?',NULL,5),(158,2,61,2081,'module_name','Institutions Manager',NULL,5),(159,2,61,2081,'most','Most',NULL,5),(160,2,61,2081,'name','Name',NULL,5),(161,2,61,2081,'none','None',NULL,5),(162,2,61,2081,'ownershiprecords','How many of your institution\'s audiovisual items have records detailing their ownership and/or which rights are assigned to the institution?',NULL,5),(163,2,61,2081,'preservation','Preservation Planning',NULL,5),(164,2,61,2081,'preservationplan','Does your institution have a general preservation plan for its collections?',NULL,5),(165,2,61,2081,'some','Some',NULL,5),(166,2,61,2081,'staffcleanrepair','How many of the media formats that your institution collects are you and/or your staff trained to clean and repair',NULL,5),(167,2,61,2081,'staffplaybackinspections','Do you or your staff perform playback inspections of media?',NULL,5),(168,2,61,2081,'staffvisualinspections','Do you or your staff perform visual inspections of media?',NULL,5),(169,2,62,2081,'avghumidity','Humidity can be very damaging to audiovisual materials. Measure the average humidity in your storage space (or make an educated estimate) and choose from one of the humidity ranges. \n\n[url=packages/avsap/adminhelp/storage/eng/avghumidity.html]Click through[/url] for more information about humidity had how it impacts audiovisual collections.',NULL,3),(170,2,62,2081,'avgtemp','Temperature control is critical to preserving your audiovisual items. Measure the average temperature in your storage space (or make an educated estimate) and choose from one of the temperature ranges. \n\n[url=packages/avsap/adminhelp/storage/eng/avgtemp.html]Click through[/url] for more information about temperature had how it impacts audiovisual collections.',NULL,3),(171,2,62,2081,'hasfiredetection','Fire can be catastrophic to your collections. If you have fire detection systems in this storage area, click \"yes\" and if not, click \"no.\" \n\n[url=packages/avsap/adminhelp/storage/eng/hasfiredetection.html]Click through[/url] for more information about fire detection in storage facilities.',NULL,3),(172,2,62,2081,'hasfiresuppression','Responding to fires is critical in storage facilities. If you have a fire suppression system in this storage area click \"yes\" and if not, click \"no.\" \n\n[url=packages/avsap/adminhelp/storage/eng/hasfiresuppression.html]Click through[/url] for more information about fire suppression systems and audiovisual materials.',NULL,3),(173,2,62,2081,'haswaterdetection','Water can be especially damaging to your collections. If you have a water drainage system in this storage area click [b]\"yes\"[/b] and if not, click [b]\"no.[/b]\" \n\n[url=packages/avsap/adminhelp/storage/eng/haswaterdetection.html]Click through[/url] for more information about water detection in storage facilities.',NULL,3),(174,2,62,2081,'humidityvariance','Variances in humidity, like variances in temperature, can be damaging to audiovisual materials over time. Monitor this storage area\'s relative humidity over time (or make an educated guess) and click on the button that most closely approximates the variance in humidity over time. \n\n[url=packages/avsap/adminhelp/storage/eng/humidityvariance.html]Click through[/url] for more information about humidity variances and how they affect audiovisual materials.',NULL,3),(175,2,62,2081,'location','Select a pre-existing location name or add one using the add button if you have not already named this location.',NULL,3),(176,2,62,2081,'materialsonfloor','Select [b]\"yes\"[/b] if there are materials stored on the floor. \n\n[url=packages/avsap/adminhelp/storage/eng/materialstorage.html]Click through [/url]to learn about the hazards of storing collection materials on the floor.',NULL,3),(177,2,62,2081,'mediumlowtemp','40-54F',NULL,3),(178,2,62,2081,'name','Create a descriptive name for the storage facility you are assessing (e.g. Archives, First Level Storage, etc.)',NULL,3),(179,2,62,2081,'repository','Select your repository from the pull down menu, if it is not already selected.',NULL,3),(180,2,62,2081,'securitylevel','Select the level of security in this storage facility. \n\n[url=packages/avsap/adminhelp/storage/eng/securitylevel.html]Click through[/url] for a detailed description of what the different security levels represent.',NULL,3),(181,2,62,2081,'tempvariance','Wide variances in temperature can be negatively impact the preservation of audiovisual materials. Monitor the temperature in this storage area over time (or make an educated guess) and click on the button that most closely approximates the temperature variance in this storage facility. \n\n[url=packages/avsap/adminhelp/storage/eng/tempvariance.html]Click through[/url] for more information about temperature variances and how they can affect audiovisual materials.',NULL,3),(182,2,62,2081,'avghumidity','What is the annual average relative humidity for this facility?',NULL,5),(183,2,62,2081,'avgtemp','What is the annual average temperature for this facility?',NULL,