6,2,62,2081,'verylowtemp','0-32F',NULL,5),(217,2,63,2081,'acassette_appropriatecontainer','Select [b]\"yes\"[/b] if this item is in an known preservation appropriate container.\n\n[url=packages/avsap/adminhelp/audiocassette/eng/appropriatecontainer.html]Click through[/url] to see examples of appropriate storage containers.',NULL,3),(218,2,63,2081,'acassette_cartridgecondition','Select [b]\"Good\"[/b] if the cassette or cartridge has no cracks, stress fractures, dirt or dust. \n\nSelect [b]\"Fair\" [/b]for a minimal amount of the aforementioned issues if it appears that any damage won\'t impede playback of the tape. \n\nSelect [b]\"Poor\"[/b] if there is extensive damage which looks like it may impede playback. \n[url=packages/avsap/adminhelp/audiocassette/eng/cartridgecondition.html]Click through[/url] for examples and more information.',NULL,3),(219,2,63,2081,'acassette_cassettelength','Select the radio button which corresponds with the length of your audiotape. \n[url=packages/avsap/adminhelp/audiocassette/eng/cassettelength.html]Click through[/url] for information on why cassette length is an important preservation consideration.',NULL,3),(220,2,63,2081,'acassette_hasconditioninfo','Select [b]\"Yes\"[/b] if you have supporting materials about the condition of this item \n\n[url=packages/avsap/adminhelp/general/eng/hasdocumentation.html]Click through[/url] to learn about the benefit of supporting documentation',NULL,3),(221,2,63,2081,'acassette_labeling','Select [b]\"yes\"[/b] If the cartridge or cassette has any identifying labeling; otherwise, select [b]\"no\"[/b]. \n[url=packages/avsap/adminhelp/audiocassette/eng/haslabeling.html]Click through[/url] for more information on cassette labeling.',NULL,3),(222,2,63,2081,'acassette_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold. \nSelect [b]\"moderate\"[/b] if there is a slight presence of mold. \nSelect [b]\"high\"[/b] if the mold level is great. \n\n[url=packages/avsap/adminhelp/audiocassette/eng/moldlevel.html]Click through[/url] for examples and help on how to identify mold.',NULL,3),(223,2,63,2081,'acassette_orientedcorrectly','Each medium has a preferred way of sitting in storage. If you are certain you know how your item should be oriented in storage and have stored them as such, select [b]\"Yes\".  [/b]\n\n[url=packages/avsap/adminhelp/audiocassette/eng/orientedcorrectly.html]Click through[/url] for examples of how best to store your media.',NULL,3),(224,2,63,2081,'acassette_physicaldamage','Select [b]\"None/Minimal Damage\"[/b]if there is no evidence of damage.\nSelect [b]\"Moderate Damage\"[/b]if there is only slight evidence of damage\nSelect[b] \"Severe Damage\"[/b]if you observe extensive evidence of phyiscal damage\n\n[url=packages/avsap/adminhelp/audiocassette/eng/physicaldamage.html]Click through[/url] for more information about and examples of physical damage.',NULL,3),(225,2,63,2081,'acassette_playbacksqueal','Select [b]\"Yes\" [/b]if you hear any high-pitched squeals when playing back the tape. \n\n[url=packages/avsap/adminhelp/general/eng/playbacksqueal.html]Click through[/url] to learn more about what a squeal might indicate.',NULL,3),(226,2,63,2081,'acassette_recentlyplayedback','Select [b]\"Yes\"[/b] if you know this item has been played back within the last two years. \n\n[url=packages/avsap/adminhelp/general/eng/recentlyplayedback.html]Click through[/url] to learn more about playback issues.',NULL,3),(227,2,63,2081,'acassette_recordprotection','Select [b]\"Yes\"[/b] If the plastic record-protection tab has been removed. \n\nIf you\'re unsure what the recording tab is or looks like, [url=packages/avsap/adminhelp/audiocassette/eng/recordprotection.html]click through[/url] for more information.',NULL,3),(228,2,63,2081,'acassette_stickyshed','Select [b]\"None\"[/b]if there is no evidence of sticky shed. Select [b]\"Moderate\"[/b]if there is only slight evidence of sticky shed. Select[b] \"High\"[/b]if you observe extensive evidence of sticky shed. \n\n[url=packages/avsap/adminhelp/audiocassette/eng/stickyshed.html]Click through[/url] for more information on what sticky shed is and how to identify it.',NULL,3),(229,2,63,2081,'acassette_windquality','If the tape pack looks flat with no raised pieces of tape, and is tightly would select [b]\"Tight\"[/b].\n\nIf the tape pack is loose, has many popped strands, and/or an uneven wind and windowing, select [b]\"Loose\"[/b].\n\n[url=packages/avsap/adminhelp/audiocassette/eng/windquality.html]Click through[/url] for more information about tape wind.',NULL,3),(230,2,63,2081,'aopenreel_aopenreeldecay','Select [b]\"No Deterioration\"[/b] if you do not detect any acetate decay\nSelect [b]\"Deterioration Starting\"[/b] if there are slight indications of acetate decay\nSelect [b]\"Actively Deteriorating\" [/b]if there is moderate decay \nSelect [b]\"Critical Deterioration\"[/b] if the item is badly damaged and possibly unplayable\n\n[url=packages/avsap/adminhelp/audioreel/eng/isacetate.html]Click through[/url] for more information about acetate decay and how to identify it.',NULL,3),(231,2,63,2081,'aopenreel_appropriatecontainer','Select \"yes\" if this item is in an known preservation appropriate container. \n\n[url=packages/avsap/adminhelp/audioreel/eng/appropriatecontainer.html]Click through[/url] to see examples of appropriate storage containers.',NULL,3),(232,2,63,2081,'aopenreel_hasconditioninfo','Select [b]\"Yes\"[/b] if you have supporting materials about the condition of this item.\n\n[url=/packages/avsap/adminhelp/audioreel/eng/documentation.html]Click through[/url] to learn about the benefit of supporting documentation',NULL,3),(233,2,63,2081,'aopenreel_hasleader','Select \"yes\" if your item has plastic leader in good condition. \n\n[url=packages/avsap/adminhelp/audioreel/eng/hasleader.html]Click through[/url] for information on how to identify leader and its benefits.',NULL,3),(234,2,63,2081,'aopenreel_labeling','Select \"yes\" If the cartridge or cassette has any identifying labeling. \n\n[url=packages/avsap/adminhelp/audioreel/eng/haslabeling.html]Click through[/url] for more information on identifying labels and why it is important to take the time to label items.',NULL,3),(235,2,63,2081,'aopenreel_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold. \nSelect [b]\"moderate\"[/b] if there is a slight presence of mold. \nSelect [b]\"high\"[/b] if the mold level is great. \n\n[url=packages/avsap/adminhelp/audioreel/eng/hasmold.html]Click through[/url] for more information on how to identify mold.',NULL,3),(236,2,63,2081,'aopenreel_orientedcorrectly','Each medium has a preferred way of sitting in storage. If you are certain you know how your item should be oriented in storage and have stored them as such, select \"Yes\". \n\n[url=packages/avsap/adminhelp/audioreel/eng/orientedcorrectly.html]Click through[/url] for more information of how best to store this format type.',NULL,3),(237,2,63,2081,'aopenreel_physicaldamage','Select [b]\"None/Minimal Damage\"[/b]if there is no evidence of damage.\nSelect [b]\"Moderate Damage\"[/b]if there is only slight evidence of damage\nSelect[b] \"Severe Damage\"[/b]if you observe extensive evidence of phyiscal damage\n[url=packages/avsap/adminhelp/audioreel/eng/isdamaged.html]Click through[/url] for more information tape inspection tips and identifying tape damage.',NULL,3),(238,2,63,2081,'aopenreel_playbacksqueal','Select \"Yes\" if you hear any high-pitched squeals when playing back the tape.\n\n[url=packages/avsap/adminhelp/general/eng/playbacksqueal.html]Click through[/url] to learn more about what a squeal might indicate.',NULL,3),(239,2,63,2081,'aopenreel_recentlyplayedback','Select \"Yes\" if you know this item has been played back within the last two years. \n\n[url=packages/avsap/adminhelp/general/eng/recentlyplayedback.html]Click through[/url] to learn more about playback issues.',NULL,3),(240,2,63,2081,'aopenreel_spliceintegrity','If you do not see any splices on your item select, [b]\"No Splices\"[/b]\nIf your item has splices and they appear to be in good condition select, [b]\"Good\"[/b]\nIf your item has splices and they appear to be in poor condition select, [b]\"Bad\"[/b]\n\n[url=packages/avsap/adminhelp/audioreel/eng/hassplices.html]Click though[/url] for help on how to identify splices and what makes a splice good or bad.',NULL,3),(241,2,63,2081,'aopenreel_stickyshed','Select [b]\"None\"[/b] if there is no evidence of sticky shed.\nSelect [b]\"Moderate\"[/b] if there is only slight evidence of sticky shed.\nSelect [b]\"High\"[/b] if you observe extensive evidence of sticky shed.\n\n[url=packages/avsap/adminhelp/general/eng/stickyshed.html]Click through[/url] for more information on what sticky shed is and how to identify it.',NULL,3),(242,2,63,2081,'aopenreel_windquality','If the tape pack looks flat with no raised pieces of tape, select [b]\"Good\"[/b]\n\n\nIf the tape pack has a few raised pieces of tape and it looks a little loose, select [b]\"Fair\"[/b]\n\n\nIf the tape pack is loose, has many popped strands, and/or an uneven wind and windowing, select [b]\"Poor\"[/b]\n\n\n\n[url=packages/avsap/adminhelp/audioreel/eng/windquality.html]Click through[/url] for more information about tape wind.',NULL,3),(243,2,63,2081,'bad','Bad',NULL,3),(244,2,63,2081,'collectioncontentid','Use this field to link the assessment to a collection content record (if available).',NULL,3),(245,2,63,2081,'collectionid','Use this field to link the Assessment to a collection record.',NULL,3),(246,2,63,2081,'collectionname','Enter a free text name for the collection to which this item belongs.',NULL,3),(247,2,63,2081,'film_appropriatecontainer','Select [b]\"yes\"[/b] if this item is in an known preservation appropriate container; otherwise, select [b]\"no\"[/b].\n	[url=packages/avsap/adminhelp/film/eng/appropriatecontainer.html]Click through[/url] to see examples of appropriate storage containers.',NULL,3),(248,2,63,2081,'film_filmdecay','Nitrate and Acetate films decay in very different ways. \n\nClick through for more information on [url=packages/avsap/adminhelp/film/eng/nitratedecay.html]Nitrate Decay[/url].\n\nClick through for more information on [url=packages/avsap/adminhelp/film/eng/acetatedecay.html]Acetate Decay[/url].',NULL,3),(249,2,63,2081,'film_filmtype','Select [b]\"reversal\"[/b] if the film is reversal \nSelect [b]\"print\"[/b] if the film is a print\nSelect [b]\"negative\"[/b] if the film is a negative\nSelect [b]\"mag stock\"[/b] if the film is a magnetic sound track \nSelect [b]\"mixed\"[/b] if the film is composed of many different film process types which have been spliced together\n\n[url=packages/avsap/adminhelp/film/eng/filmtype.html]Click through[/url] to learn more about and examples of the different types of processed film.',NULL,3),(250,2,63,2081,'film_hasleader','Select [b]\"yes\"[/b] if this film has leader; otherwise, select [b]\"no\"[/b]. \n\n[url=packages/avsap/adminhelp/film/eng/hasleader.html]Click through [/url]for help in identifying leader and to learn about the benefits of leader.',NULL,3),(251,2,63,2081,'film_incolor','Select [b]\"color\"[/b] if the film stock is color. \nSelect [b]\"black and white\"[/b] if the film stock is black and white. \nSelect [b]\"both\"[/b] if both color and black and white film stock has been spliced together. \n\n[url=packages/avsap/adminhelp/film/eng/incolor.html]Click through[/url] for more information on color and black and white film stock.',NULL,3),(252,2,63,2081,'film_labeling','Select [b]\"yes\"[/b] If the cartridge or cassette has any identifying labeling; otherwise, select [b]\"no\"[/b].\n\n[url=packages/avsap/adminhelp/film/eng/haslabeling.html]Click through[/url] to learn more about the importance of and other issues related to labeling.',NULL,3),(253,2,63,2081,'film_magstockbreakdown','Select [b]\"yes\"[/b] if the item is exhibiting signs of mag stock breakdown; otherwise, select [b]\"no\"[/b].\n\n[url=packages/avsap/adminhelp/film/eng/magstockbreakdown.html]Click through[/url] to learn more about and how to identify mag stock breakdown',NULL,3),(254,2,63,2081,'film_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold.\nSelect [b]\"moderate\"[/b] if there is a slight presence of mold.\nSelect [b]\"high\"[/b] if the mold level is great.\n\n[url=packages/avsap/adminhelp/film/eng/hasmold.html]Click through [/url]for more information on how to identify mold.',NULL,3),(255,2,63,2081,'film_oncore','Select [b]\"yes\"[/b] if this film is on a known archival core; otherwise, select [b]\"no\"[/b].\n\n[url=packages/avsap/adminhelp/film/eng/oncore.html]Click through[/url] for more information on film cores.',NULL,3),(256,2,63,2081,'film_orientedcorrectly','Each medium has a preferred way of sitting in storage. If you are certain you know how your item should be oriented in storage and have stored them as such, select [b]\"yes\"[/b]; otherwise, select [b]\"no\"[/b]. \n\n[url=packages/avsap/adminhelp/film/eng/orientedcorrectly.html]Click through[/url] for more information of how best to orient your media in storage.',NULL,3),(257,2,63,2081,'film_physicaldamage','If you observe extensive evidence of phyiscal damage\n\n[url=packages/avsap/adminhelp/film/eng/physicaldamage.html]Click through[/url] for more information about and examples of physical damage.',NULL,3),(258,2,63,2081,'film_shrinkage','Select [b]\"None\"[/b] if the film is polyester and/or is not exhibiting any signs of shrinkage\nSelect [b]\"Moderate\"[/b] if the film is exhibiting some shrinkage\nSelect [b]\"High\"[/b] if the film is exhibiting significant shrinkage\n\n[url=packages/avsap/adminhelp/film/eng/shrinkage.html]Click through[/url] to learn about shrinkage and what levels are considered moderate and high.',NULL,3),(259,2,63,2081,'film_soundtracktype','Select [b]\"optical\"[/b] if the film soundtrack is optical \nSelect [b]\"magnetic\"[/b] if the film soundtrack is magnetic\nSelect [b]\"none\"[/b] if the film does not have a soundtrack\n\n[url=packages/avsap/adminhelp/film/eng/soundtracktype.html]Click through[/url] to learn more about film soundtracks and how to identify the different types',NULL,3),(260,2,63,2081,'film_spliceintegrity','Select [b]\"No Splices\"[/b] if the film does not have any splices\nSelect [b]\"Good\"[/b] if the film has splices which are in good condition\nSelect [b]\"Bad\"[/b] if the film has splices which are in poor condition\n\n[url=packages/avsap/adminhelp/film/eng/spliceintegrity.html]Click through[/url] for more information about splices and how to identify them',NULL,3),(261,2,63,2081,'groovedcyl_appropriatecontainer','Select \"yes\" if this item is in a known preservation appropriate container. \n\n[url=packages/avsap/adminhelp/cylinder/eng/appropriatecontainer.html] Click through[/url] to see examples of appropriate storage containers.',NULL,3),(262,2,63,2081,'groovedcyl_dustlevel','Select \"none\" if you don\'t see any signs of dust/dirt.\nSelect \"moderate\" if there is a slight presence of dust/dirt.\nSelect \"high\" if the dust/dirt level is great.\n\n[url=packages/avsap/adminhelp/cylinder/eng/isdirty.html]Click through[/url] to learn more about the preservation issues related to dust and dirt',NULL,3),(263,2,63,2081,'groovedcyl_hasconditioninfo','Select [b]\"Yes\"[/b] if you have supporting materials about the condition of this item.\n\n[url=packages/avsap/adminhelp/cylinder/eng/hasdocumentation.html]Click through[/url] to learn about the importance of supporting documentation.',NULL,3),(264,2,63,2081,'groovedcyl_labeling','Select[b] \"yes\"[/b] If the cylinder or container has any identifying labeling. \n\n[url=packages/avsap/adminhelp/cylinder/eng/haslabeling.html]Click through[/url] to learn more about the significance of labeling.',NULL,3),(265,2,63,2081,'groovedcyl_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold.\nSelect [b]\"moderate\"[/b] if there is a slight presence of mold.\nSelect [