orage containers.',NULL,3),(271,2,63,2081,'grooveddisc_corematerial','Select [b]\"aluminum[/b]\" if the disc\'s core material is aluminum or a metal-based\nSelect [b]\"cardboard\"[/b] if the disc\'s core material is cardboard or paper-based\nSelect [b]\"glass\"[/b] if the disc\'s core material is glass \nSelect [b]\"I Don\'t Know\"[/b] if you\'re unsure of the core material. \n\n[url=packages/avsap/adminhelp/disk/eng/innercore.html]Click through[/url] for more information about how to identify core materials and preservation issues',NULL,3),(272,2,63,2081,'grooveddisc_dustlevel','Select [b]\"none\"[/b] if you don\'t see any signs of dust/dirt.\nSelect [b]\"moderate\"[/b] if there is a slight presence of dust/dirt.\nSelect [b]\"high\"[/b] if the dust/dirt level is great.\n\n[url=packages/avsap/adminhelp/disk/eng/isdirty.html]Click through[/url] to learn more about the preservation issues related to dust and dirt',NULL,3),(273,2,63,2081,'grooveddisc_hasconditioninfo','Select [b]\"Yes\"[/b] if you have supporting materials about the condition of this item\n\n[url=packages/avsap/adminhelp/general/eng/hasdocumentation.html]Click through[/url] to learn about the benefit of supporting documentation',NULL,3),(274,2,63,2081,'grooveddisc_hasinnersleeve','Select [b]\"yes\" [/b]if this item has an inner sleeve. \n\n[url=packages/avsap/adminhelp/disk/eng/hasinnersleeve.html]Click though[/url] to learn more about preservation issues related to the inner sleeve.',NULL,3),(275,2,63,2081,'grooveddisc_labeling','Select [b]\"yes\"[/b] If the disc or container has any identifying labeling. \n\n[url=packages/avsap/adminhelp/disk/eng/haslabeling.html]Click through[/url] to learn more about the importance of labeling.',NULL,3),(276,2,63,2081,'grooveddisc_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold. \nSelect [b]\"moderate\"[/b] if there is a slight presence of mold. \nSelect [b]\"high\"[/b] if the mold level is great. \n\n[url=packages/avsap/adminhelp/disk/eng/ha