st. \n\nSelect [b]\"Fair\"[/b] for a minimal amount of the aforementioned issues if it appears that any damage won\'t impede playback of the tape. \n\nSelect [b]\"Poor\"[/b] if there is extensive damage which looks like it may impede playback. \n\n[url=packages/avsap/adminhelp/videocassette/eng/cassettecondition.html]Click through[/url] for more information and examples.',NULL,3),(304,2,63,2081,'vcassette_hasconditioninfo','Select [b]\"Yes\"[/b] if you have supporting materials about the condition of this item. \n\n[url=packages/avsap/adminhelp/general/eng/hasdocumentation.html]Click through[/url] to learn about the benefit of supporting documentation',NULL,3),(305,2,63,2081,'vcassette_labeling','Select [b]\"yes\"[/b] If the cartridge or cassette has any identifying labeling. [url=packages/avsap/adminhelp/videocassette/eng/haslabeling.html]Click through[/url] for more information on cassette labeling.',NULL,3),(306,2,63,2081,'vcassette_moldlevel','Select [b]\"none\"[/b] if you don\'t see any signs of mold. \nSelect [b]\"moderate\"[/b] if there is a slight presence of mold. \nSelect [b]\"high\"[/b] if the mold level is great.\n\n[url=packages/avsap/adminhelp/videocassette/eng/hasmold.html]Click through[/url] for examples and help on how to identify mold.',NULL,3),(307,2,63,2081,'vcassette_orientedcorrectly','Each medium has a preferred way of sitting in storage. \nIf you are certain you know how your item should be oriented in storage and have stored them as such, select [b]\"Yes\"[/b].  \n\n[url=packages/avsap/adminhelp/videocassette/eng/orientedcorrectly.html]Click through[/url] for examples of how best to store your media.',NULL,3),(308,2,63,2081,'vcassette_physicaldamage','Select [b]\"None/Minimal Damage\"[/b]if there is no evidence of damage.\nSelect [b]\"Moderate Damage\"[/b]if there is only slight evidence of damage\nSelect[b] \"Severe Damage\"[/b]if you observe extensive evidence of phyiscal damage\n\n[url=packages/avsap/adminhelp/videocassette/eng/physicaldamage.html]Click through[/url] for more information about and examples of physical damage.',NULL,3),(309,2,63,2081,'vcassette_playbacksqueal','Select [b]\"Yes\"[/b] if you hear any high-pitched squeals when playing back the tape. \n\n[url=packages/avsap/adminhelp/general/eng/playbacksqueal.html]Click through[/url] to learn more about what a squeal might indicate.',NULL,3),(310,2,63,2081,'vcassette_recentlyplayedback','Select \"Yes\" if you know this item has been played back within the last two years. [url=packages/avsap/adminhelp/general/eng/recentlyplayedback.html]Click through[/url] to learn more about playback issues.',NULL,3),(311,2,63,2081,'vcassette_recordprotection','Select [b]\"Yes\" [/b]If the record-protection is enabled on this cassette. \n\nThere are many different ways on engaging record-protection depending upon the videocassette format. \nIf you\'re unsure how to protect your tape from recording, [url=packages/avsap/adminhelp/videocassette/eng/copyprotection.html]click through[/url] for more information.',NULL,3),(312,2,63,2081,'vcassette_stickyshed','Select [b]\"None\"[/b]if there is no evidence of sticky shed. \nSelect [b]\"Moderate\"[/b]if there is only slight evidence of sticky shed. Select [b]\n\"High\"[/b] if you observe extensive evidence of sticky shed. [url=packages/avsap/adminhelp/general/eng/stickyshed.html]Click through[/url] for more information on what sticky shed is and how to identify it.',NULL,3),(313,2,63,2081,'vcassette_windquality','If the tape pack looks flat with no raised pieces of tape, select [b]\"Good\"[/b]. \nIf the tape pack has a few raised pieces of tape and it looks a little loose, select [b]\"Fair\"[/b]. \nIf the tape pack is loose, has many popped strands, and/or an uneven wind and windowing, select [b]\"Poor\"[/b]. \n\n[url=packages/avsap/adminhelp/audiocassette/eng/windquality.html]Click through[/url] for more information about tape wind.',NULL,3),(314,2,63,2081,'vopenreel_appropriatecontainer','Select [b]\"yes\"[/b]