ontent_userfields_value','Enter the text of the user defined field.  This value will be mapped into the EAD element specified with the head or label specified in the label/head field.',NULL,3),(821,5,69,2081,'creators','Open this section to link creator authority records to the collection.',NULL,3),(822,5,69,2081,'creators_arrows','After highlighting a creator name, use the right arrow to link it to the current collection.  Use the left arrow to unlink the creator. CTRL-click selects multiple creators and SHIFT-click selects a range of items.',NULL,3),(823,5,69,2081,'creators_creatorsearch','Use the upper box to filter names from the master list of creators, then double click a creator name from the filtered list (or use the arrows) to apply it to the collection.  The first creator to appear in the right hand list will be identified as the primary creator of the collection.',NULL,3),(824,5,69,2081,'description','Open this section to record descriptive information, such as a scope and content, arrangement note, or alternate extent statement for the collection.',NULL,3),(825,5,69,2081,'description_abstract','Use this field to provide an abstract.',NULL,3),(826,5,69,2081,'description_altextentstatement','Use this field to record an alternate or expanded statement regarding the extent and physical nature of the materials being described. (See DACS Rule 2.5 for more information.)',NULL,3),(827,5,69,2081,'description_arrangement','Use this field to provide a short note regarding the order of the materials or to identify the aggregations of archival material, their relationships, or the sequence of documents within them. (See DACS Rule 3.2 for more information.)',NULL,3),(828,5,69,2081,'description_bioghist','Use this field to provide information about the organization or individual associated with the creation, assembly, accumulation and/or maintenance of the archival materials for the collection.',NULL,3),(829,5,69,2081,'description_bioghistauthor','Use this field to record the name of the individual or individuals who created the biographical or historical note.',NULL,3),(830,5,69,2081,'description_scope','Use this field to provide a scope note, i.e. information about the overall nature of the materials and activities reflected in the collection, in order to enable users to judge its potential relevance. (See DACS Rule 3.1 for more information.)',NULL,3),(831,5,69,2081,'details_header','Use the \'Collections Manager\' to create new collection records and edit existing ones. Collections may be grouped hierarchically according to classifications established in the Classification Manager. Click the Content Manager button to create a finding aid or inventory, or to describe the subordinate components of a collection, such as the series, boxes, folders, or items.',NULL,3),(832,5,69,2081,'enabled','Changing this radio button to \'no\' will suppress the public view of the collection\'s summary record and finding aid.',NULL,3),(833,5,69,2081,'extent','Use this field to record the units of measure which most accurately represents the overall extent of the collection.  Additional information about the collection\'s extent can be provided in the Alternate Extent Statement Field in the collection description area (See DACS Rule 2.5 for more information).',NULL,3),(834,5,69,2081,'findingaid','Open this section to record information regarding the descriptive record itself, the processing of the collection, or the author of the finding aid.',NULL,3),(835,5,69,2081,'findingaid_descriptiverulesid','Use this drop-down list to record the set of descriptive rules under which the collection description was developed (e.g. DACS or APPM).',NULL,3),(836,5,69,2081,'findingaid_findinglanguageid','Use this drop-down list to select the language in which the collection description was written.',NULL,3),(837,5,69,2081,'findingaid_processinginfo','Use this field to record information regarding the processing of the collection that would aid potential users in understanding or using the materials (e.g., information regarding the use of a sampling technique, heavy weeding, or reformatting of originals).',NULL,3),(838,5,69,2081,'findingaid_publicationdate','Use this field to record the year in which the collection description was written.',NULL,3),(839,5,69,2081,'findingaid_publicationnote','Use this field to record any relevent information concerning the publication of the finding aid or other descriptive information regarding the collection.',NULL,3),(840,5,69,2081,'findingaid_revisionhistory','Use this field to record information about revisions to the finding aid or descriptive record.',NULL,3),(841,5,69,2081,'findingaidauthor','Use this field to record the name or names of the individuals responsible for preparing this descriptive record.',NULL,3),(842,5,69,2081,'genres','Open this section to record the genres or forms of material included in the collection.',NULL,3),(843,5,69,2081,'genres_arrows','After highlighting a genre/form of material, use the right arrow to link it to the current collection.  Use the left arrow to unlink it. CTRL-click to select multiple genres and SHIFT-click to select a range of genres.',NULL,3),(844,5,69,2081,'genres_genresearch','Use the upper box to filter terms from the master list of genres, then double click a genre term from the filtered list (or use the arrows) to apply it to the collection.',NULL,3),(845,5,69,2081,'header','To find an existing collection record, type the collection title or ID into the \'Filter\' box.  Then click the title.\n\nIf your institution uses the classification manager to group collections into record groups, separate components of the ID with slashes, e.g \'12/2/24\' for record group \'12\', subgroup \'12\', record series \'24\'.\n\nTo add a new collection, click \'New\'.',NULL,3),(846,5,69,2081,'inclusivedates','Use this field to record the date(s) that pertain to the creation, assembly, or accumulation of the materials being described.  As necessary, use a single date, span of dates, or comma separated list of dates and/or date spans.  (See DACS Rule 2.4 for more information.)',NULL,3),(847,5,69,2081,'languages','Open this section if you to define the language or languages used in the materials in the collection.',NULL,3),(848,5,69,2081,'languages_arrows','After highlighting a language, use the right arrow to link it to the current collection.  Use the left arrow to unlink it.  CTRL-click selects multiple languages and SHIFT-click selects a range of items.',NULL,3),(849,5,69,2081,'languages_languagesearch','Use the upper box to filter the master list of languages, then double click a language in the filtered list (or use the arrows) to apply it to the collection.',NULL,3),(850,5,69,2081,'locations','Open this area to record the permanent locations where boxes or other containers are stored.',NULL,3),(851,5,69,2081,'locations_content','Use this field to record the container number(s) that are stored at the specified location.',NULL,3),(852,5,69,2081,'locations_extent','Use these fields to record information regarding the extent of the boxes or other containers stored in the specified location.',NULL,3),(853,5,69,2081,'locations_locationid','Use this pull-down list to select the master location (e.g. room or building) where the specified materials are stored.  Additional rooms or buildings can be defined in the \"Location Manager.\"',NULL,3),(854,5,69,2081,'locations_rangevalue','Use this field to record the number (or other identifier) of the shelving range where the specified materials are stored.',NULL,3),(855,5,69,2081,'locations_section','Use this field to record the specific section (of a range) in which the materials are stored.',NULL,3),(856,5,69,2081,'locations_shelf','Use this field to record the specific shelf (at a specified section) on which the materials are stored.',NULL,3),(857,5,69,2081,'materialtypeid','Use this field to record the basic \'type\' of materials being described (e.g. official records, personal papers, or publications).  Additional types can be added by editing the table \'tblCol_MaterialTypes\' in the database on the database server where Archon is installed.)',NULL,3),(858,5,69,2081,'normaldates','Use this field to record a single year or the first and last year covered by the materials in the collection.  Normally this field will be automatically completed when you enter the inclusive dates.  The information in this field is required for MARC output of the collection record.',NULL,3),(859,5,69,2081,'other','Open this section to record descriptive information relating to the collection that cannot be accommodated in other fields.',NULL,3),(860,5,69,2081,'other_othernote','Use this field to record information that cannot be accommodated in any of the defined elements of description (See DACS Rule 7.1 for more information).',NULL,3),(861,5,69,2081,'other_otherurl','Use this field to record a URL related to the collection.  Use must be defined by local practice; at UIUC it is used to link to PDF finding aids for inventories not yet imported to the Archon system. The URL should be an absolute URL.',NULL,3),(862,5,69,2081,'predominantdates','Use this field to indicate the dates pertaining to the majority of the documents in the collection being described, when those differ significantly from the inclusive dates.  In other words, this field is used to provide \'predominant\' or \'bulk\' dates. ( There is no need to record the word \'predominant\' or \'bulk\', as it will automatically be added to the descriptive output.)',NULL,3),(863,5,69,2081,'primary_creator','Use this field to select a creator record to associate as the primary creator for the records/collections.',NULL,3),(864,5,69,2081,'related','Open this section to record information about related or separated materials.',NULL,3),(865,5,69,2081,'related_origcopiesnote','Use this field to record information describing the existence, location, and availability of originals or copies of the materials being described (See DACS Rules 6.1 and 6.2.)',NULL,3),(866,5,69,2081,'related_origcopiesurl','Use this field to record a URL relating to originals or copies of the materials being described. The URL should be an absolute URL.',NULL,3),(867,5,69,2081,'related_preferredcitation','Use this field to record the preferred citation which users should utilize when referencing the collection in published or unpublished works.',NULL,3),(868,5,69,2081,'related_relatedmaterials','Use this field to record information regarding the existence and location of archival materials that are closely related to the materials being described by provenance, sphere of activity, or subject matter, either in the same repository, in other repositories, or elsewhere. (See DACS Rule 6.3 for more information.)',NULL,3),(869,5,69,2081,'related_relatedmaterialsurl','Use this field to record the URL of a website referencing materials related to the collection being described. The URL should be an absolute URL.',NULL,3),(870,5,69,2081,'related_relatedpublications','Use this field to identify any publication that are about or based on the use, study, or analysis of the materials being described. (See DACS element 6.4 for more information.)',NULL,3),(871,5,69,2081,'related_separatedmaterials','Use this field to record information about materials that are associated by provenance to the described materials but that have been physically separated or removed from the collection for various reasons, including the dispersal of special formats to more appropriate custodial units, the destruction of duplicate or nonessential material, and the deliberate or unintentional scattering of materials among different repositories.',NULL,3),(872,5,69,2081,'repositoryid','Use this drop-down list to select the repository that manages the collection being added or updated.',NULL,3),(873,5,69,2081,'restrictions','Open this section to record information on access, use or other restrictions related to the collection.',NU