amed level will restart at 1 when the level is used within a new parent level in the Content Manager.  For example, if \'yes\' is checked for the \'item\' level,  and you move to a new folder, the next number assigned to an item will be 1.',NULL,3),(1071,5,74,2081,'header','Use the Level/Container Manager to define, edit or delete the levels of description and types of physical containers in which materials may be nested using the Content Manager.',NULL,3),(1072,5,74,2081,'intellectuallevel','Check \'Intellectual Level\' if the name of the level/container represents ONLY an intellectual level of description, such as \'record group,\' \'series,\' or \'item.\' Whenever the named level is selected in the Content Manager, the value recorded in the \'EAD level\' field will be output as the level attribute of the <c0x> element. \nCheck both \"Intellectual Level\" and \"Physical Container\" if the level/container is intended to represent both a physical container and an intellectual level of description. </c0x>Whenever the named level is selected in the Content Manger, the value of the EAD level will be written to the level attribute of the <c0x> level, and a <container> element will be recorded with the container number supplied by the administrative user, at the component (<c0x> level where it is recorded, and all levels nested within it).</c0x></container></c0x>',NULL,3),(1073,5,74,2081,'levelcontainer','Use this field to define or edit the name associated with an intellectual level of description and/or container type. The levels/containers named here will be available for use in the Content Manager.',NULL,3),(1074,5,74,2081,'physicalcontainer','Check \'Physical Container\' if the name of the level/container represents ONLY a physical container in which archival materials are stored. Whenever the named level is used in the Content Manger, the container number recorded in the Content Manger will be applied to all content nested underneath it. For example, if the level name is box and the level/container number is set to 10, a <container type=\"box\">10</container> element will be encoded in the EAD output for content nested in the box 10. The administrative user will be able to provide ONLY a title and dates the box itself and the title and dates will NOT be recorded in the EAD output. All information about materials in box 10 MUST be recorded in subsequent levels.',NULL,3),(1075,5,74,2081,'primaryeadlevel','Check \'No\' if the Container type is NOT the primary one which maps to the value of the \'EAD Level\" defined above.  For example, if the \'Container Type\' is set to \'Tube\' and \'EAD level\' is set to \'file,\' check no.',NULL,3),(1076,5,74,2081,'eadlevel','EAD Level',NULL,5),(1077,5,74,2081,'globalnumbering','Global Numbering',NULL,5),(1078,5,74,2081,'header','Level/Container Manager',NULL,5),(1079,5,74,2081,'intellectuallevel','Intellectual Level',NULL,5),(1080,5,74,2081,'levelcontainer','Level/Container',NULL,5),(1081,5,74,2081,'module_name','Level/Container Manager',NULL,5),(1082,5,74,2081,'physicalcontainer','Physical Container',NULL,5),(1083,5,74,2081,'primaryeadlevel','Primary EAD Level',NULL,5),(1087,5,0,2081,'header','Use the Researcher Types Manager to develop a list of general categories describing the different kinds of researchers who use your repository, e.g. students, faculty, or members of the public.',NULL,3),(1088,5,0,2081,'header','Researcher Types Manager',NULL,5),(1089,5,0,2081,'module_name','Researcher Types Manager',NULL,5),(1090,5,0,2081,'researchertype','Researcher Type',NULL,5),(1091,5,75,2081,'extentunit','Use this field to record a unit of physical size or extent.',NULL,3),(1092,5,75,2081,'header','Use the Extent Units Manger to define units which describe the physical size or extent of a collection.  The units defined here will be available for selection in a drop-down box in the Collection Manager.',NULL,3),(1093,5,75,2081,'extentunit','Extent Unit',NULL,5),(1094,5,75,2081,'header','Extent Uni